import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'
import Typing from 'react-typing-animation';

class TitleText extends Component {

  constructor( props )
  {

    super( props );

    this.title            = props.title;
    this.arr_descriptions = prop.typing_arr_descriptions

  }

  render() {
    return (
      <div data-component="cover-page">

        <div className="container-page hidden">

          <p data-title>{ this.title }</p>

          <Typing loop={true}
                  speed={25} >
          {
            this.arr_descriptions.map( function( description ){

              return (
                <div>
                  <span data-description-typing>{ description }</span>
                  <Typing.Delay ms={2000} />
                  <Typing.Backspace count={ description.length + 1 } />
                </div>
              );

            })
          }
          </Typing>

        </div>
      </div>
    );
  }
}
export default TitleText;
